import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sidebar to be visible
    await page.waitForSelector('.sidebar');

    // Click on the Profile menu item using a different selector strategy
    const profileSelector = 'div.sidebar-item[data-page="profile"]';
    await page.waitForSelector(profileSelector);
    await page.click(profileSelector);

    // Take a screenshot after clicking on the Profile menu
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_clicked.png'));

    // Verify that we are on the profile page
    const profileActive = await page.evaluate(() => {
      return document.querySelector('.sidebar-item.active[data-page="profile"]') !== null;
    });

    return {
      success: profileActive,
      action: "Clicked on the Profile menu and navigated to the profile page",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
